Описание:
Компания "Этажи-Владивосток" предлагает к продаже Коммерческую территорию.
Объект и земельный участок подходит под коммерческие виды деятельности. 
Условия продажи: 
Предложение: Без агентских комиссий и платежей! 
Характеристика объекта:
- первая линия; 
- общая площадь 9000 м2.
Состав помещений: 
- 12 производственный и складских помещений объединённых в одно общее строение;
- каждое помещение имеет отдельный изолированный вход;
- на втором этаже одного из корпусов расположено общежитие;
Площадь земельного участка имеет:
- подъездные пути к зданию со всех сторон;
- выделенный земельный участок для размещения автомобилей или свободных грузов;
- огражден сеткой;
- имеет выделенные ворота для въезда.
Локация: 
Объект находится в районе с развитой инфраструктурой на первой линии, имеется рядом столовая. 
